import React from "react";
import Moment from "moment";

class LetterAndQuote extends React.Component {
  render() {
    return (
      <div
        style={{
          height: "95%",
          width: "95%",
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          fontFamily: "Dancing",
          borderRadius: "25px",
          boxShadow: "3px 6px 10px 10px #585858",
        }}
      ></div>
    );
  }
}

export default LetterAndQuote;
